import HomePage from "./pacientHome/pacientHome";
import {Route, Routes} from "react-router-dom";
import LayoutAfterLogIn from "./pacientHome/Layout_After_LogIn_Pacient/Layout_After_LogIn";


function SiteAfterLogIn(){
    return(
    <div>
        <Routes>
            <Route
                path="/"
                element={
                    <LayoutAfterLogIn>
                        <HomePage/>
                    </LayoutAfterLogIn>
                }
            />

        </Routes>
    </div>
    );
}

export default SiteAfterLogIn;
